mapper.select:

select

  distinct


from order_express_tracing




  order by ${orderByClause}




      limit ${criterion.value},${criterion.secondValue}


select 

,

from order_express_tracing
where delivery_sn = #{deliverySn,jdbcType=VARCHAR}
  and depot_code = #{depotCode,jdbcType=VARCHAR}
  and order_sn = #{orderSn,jdbcType=VARCHAR}
  and trackno = #{trackno,jdbcType=VARCHAR}

mapper.delete:

delete from order_express_tracing
where delivery_sn = #{deliverySn,jdbcType=VARCHAR}
  and depot_code = #{depotCode,jdbcType=VARCHAR}
  and order_sn = #{orderSn,jdbcType=VARCHAR}
  and trackno = #{trackno,jdbcType=VARCHAR}
